import React from 'react';
import { Link, Router } from 'react-router-dom';

const { sell, rent, partners, nonResi } = {
    sell: "מכירה",
    rent: "השכרה",
    partners: "דירות שותפים",
    nonResi: 'נדל"ן מסחרי'
};

const Header = () => {
    return (
        <div> ----header----

                   
                   
                           <Link to="/forsale">{sell}</Link>
                  
                 

        </div>
    );
}


export default Header;
